return {
	["*Muttering*"] = "*Odburkuje pod nosem*",
	["O tempora, {o mores}! What do you want from me?"] = "O tempora, {o mores}! Dlaczego mnie tak gnebisz? - czego Ty ode mnie chcesz?",
	["Maybe the punishment was appropriate for my actions. Nevertheless, I don't want to return to society; not as Tomek. Here, in Ratland, nobody knows me. By the way, what was all that fuss about the King of Rats? Anyway, it doesn't matter because I will become the King of Rats. Propane, butane, I have a cunning plan. I'll have to impress the rats to be crowned as their new monarch. Maybe you'd like to help me?"] = "Moze i kara byla odpowiednia do mojego czynu. Niemniej nie chce wracac do spoleczenstwa; nie jako tomasz. Tutaj, w szczurolandii, nikt mnie nie zna. A tak w ogole o co chodzilo z tym krolem szczurow? W sumie nie wazne, bo to ja zostane krolem szczurow. Propan, butan, mam chytry plan. Bede musial zaimponowac szczurom, zeby mianowaly mnie na nowego monarche. Moze bedziesz chcial mi pomoc?",
	["This will be your first task: find something that rats crave the most - cheese. But it can't be just any cheese from under someone's foreskin or parmesan growing under fingernails. These rats have access to the latest cheeses, and they won't be impressed. To satisfy them, you'll have to find the legendary matured cheese with flowers. It's possible that the pirates have such cheese. It's probably well hidden. Their hideout is on the southern shore of Hurghada."] = "To bedzie twoje pierwsze zadanie: znajdz mi cos co szczury lubia najbardziej - ser. Tyle ze nie moze to byc byle twarog spod napleta czy parmezan rosnacy pod paznokciami. Te szczury maja dostep do najnowszych serow, i nie beda pod wrazeniem. Aby je zadowolic, bedziesz musial znalezc legendarny dojrzewajacy ser z kwieciszy. Mozliwe, ze taki ser jest w posiadaniu piratow. Prawopodobnie jest dobrze schowany. Ich kryjowka znajduje sie na poludniowym brzegu hurghady.",
	["Thanks for the cheese. Your further help might be... helpful in my future reign. If you want, I can appoint you as my {assistant}."] = "Dzieki za ser. Twoja dalsza pomoc moze sie okazac... pomocna w moim dalszym panowaniu. Jezeli chcesz, to moge cie mianowac na mojego {pomocnika}.",
	["Return when you've obtained the special cheese."] = "Wroc, gdy zdobedziesz dla mnie specjalny ser.",
	["Hello, |PLAYERNAME|. Do you have the special cheese I asked for?"] = "Witaj |PLAYERNAME|. Czy masz juz specjalny ser, o ktory prosilem?",
	["Who is the King of Rats, and what is his power?"] = "Kim jest krol szczurow, i na czym polega jego potega?",
	["Now, the next question: The King of Rats is a ruler who is aggressive but ...?"] = "Teraz nastepne pytanie: Krol szczurow jest wladca agresywnym ale ...?",
	["You're doing well. Now it's time for the third and final task. Translate 'Custodian' to Polish."] = "Dobrze Ci idzie. Teraz pora na trzecie i zarazem ostatnie zadanie. Przetlumacz 'Custodian' na polski.",
	["I appoint you as a rat that there are many! Come back in some time, and I'll surely find a responsible task for you."] = "Mianuje cie na szczura jakich pelno! Wroc za jakis czas, a na pewno znajde dla ciebie odpowiedzialne zadanie.",
	["If you want to become my assistant, you must pass the ratometer test. Are you ready?"] = "Jezeli chcesz zostac moim pomocnikiem, to musisz przejsc test memiarza. Czy jestes gotowy?",
	["Find my eternal enemy, tormentor, and oppressor, even though children in Africa are starving: Ms. Pitca, and arrange a Brazilian elevator for her. From the latest memes I read, she was heading towards Siberia. She seems to have her mother's intelligence, so you shouldn't have trouble dealing with her."] = "Znajdz mojego odwiecznego wroga, gnebiciela, dreczyciela, oprawce, mimo, ze dzieci w afryce gloduja: Pania Pitce, i zrob jej brazylijska randke w ciemno. Jak czytalem ostatnie memy, to jechala w strone sybiru. Rozum to ona ma chyba po matce, wiec nie powiniennes miec z nia klopotow.",
	["Ms. Pitca is somewhere in Siberia. She might have tried to schmooze with the Business Giants."] = "Pani Pitca znajduje sie gdzies na sybirze. Mozliwe, ze probowala zbic pione z Gigantami biznesu.",
	["Hello. Have you completed the task yet?"] = "Witaj. Czy wykonales juz zadanie?",
	["Ignavia corpus habetat labor firmat."] = "Ignavia corpus habetat labor firmat.",
	["Aaaaa!!!"] = "Aaaaa!!!",
	["What have you done? Brain-dead oppressor, tyrant, penguin of Madagascar, smarty pants, brainless killer, scoundrel. Oh no, it's me. I made a magical vow with Ms. Pitca. If I ever mention Ms. Pitca to anyone, I'll age a hundred times faster than a regular person. I think I have no more than a few months left to live. Here's the battle mission: I want you to try to remove this curse from me. Maybe the grave digger can help me at a costly but fair price."] = "Cos Ty narobil. Bezmozgi ciemiezycielu, ciemiezco, oprawco, pingwinie z madagaskaru, chytrusie, bezmozgu, morderco, hultaju. A nie, to ja. Zawarlem z Pania Pitca magiczna przysiege. Jezeli kiedykolwiek powiem o Pani Pitcy komukolwiek, to zaczne sie starzec sto razy szybciej niz zwykly czlowiek. Mysle, ze zostalo mi nie wiecej niz pare miesiecy zycia. Oto bojowa misja: chce, zebys sprobowal zdjac ze mnie te klatwe. Byc moze grave digger bedzie umial mi pomoc za cene kosztowna, acz sprawiedliwa.",
	["It's you again? If you're looking for the grave digger, you'll find him in Mirko. He runs his office supply store there."] = "To znowu ty? Jezeli szukasz grave diggera, to znajdziesz go w mirko. Prowadzi tam swoj sklep z artykulami biurowymi.",
	["So, do you have what Grave Digger talked about?"] = "I co? Masz juz to, o czym mowil Grave Digger?",
	["Thanks, I'll check the effect of this book right away. Here's your reward."] = "Dzieki, zaraz sprawdze dzialanie tej ksiegi. Oto twoja nagroda.",
	["I'm planning a party soon, and I need some catering. We can't rely on Ms. Pitca's services anymore, so I thought about ordering kebabs. Go to Shivganesh and ask him about the possibility of organizing a kebab set."] = "Niedlugo bede organizowac domowke, i potrebuje jakiegos kateringu. Nie mozemy juz liczyc na uslugi Pani Pitcy, wiec pomyslalem, zeby zamowic kebaby. Udaj sie do Shivganesh i zapytaj go o mozliwosc organizacji zestawu kebabow.",
	["Shivganesh has his bar right by the docks of Hurghada. The town is tiny, so you should be able to find it easily."] = "Shivganesh ma swoj bar tuz przy dokach hurghady. Z reszta to miasteczko jest malutkie - z pewnoscia sam go znajdziesz.",
	["Thanks for your help. Here's your reward."] = "Dzieki za pomoc. Oto twoja nagroda.",
	["My missing son Kitz is trying to reconnect. Unfortunately, it wasn't easy to shoo him off. The ingrate has been taking alimony all his life, and now that he's of age, he has to earn his own living. A thief will steal anything that's not nailed to the ground. He's trying to find me to leech off me. No way. You need to get him involved in a camp, preferably a concentration camp. First, go to Arni, who deals with organizing trips."] = "Moj zaginiony syn Kitz probuje odnowic kontakty. Niestety, tego nie udalo sie wyskrobac. Niewdziecznik pobieral cale zycie alimenty, a teraz pelnoletni musi sam na siebie zarabiac. Zlodziej ukradnie wszystko co nie jest do ziemii przywiazane. Probuje mnie odnalezc, zeby moc na mnie zerowac. Nic z tego. Musisz go wkrecic w wyjazd na oboz, najlepiej koncentracyjny. Najpierw udaj sie do Arniego, ktory zajmuje sie organizacja wycieczek.",
	["Arni guards the south gate of the mirkocity."] = "Arni strzeze poludniowej bramy mirkotown.",
	["My son is on the watch at the eastern gate."] = "Moj syn aktualne trzyma warte na wschodniej bramie.",
	["So, did you manage to complete my {mission}?"] = "I jak? Udalo Ci sie wykonac moja {misje}?",
	["Thanks, finally, that scoundrel got what he deserved."] = "Dzieki, w koncu ta kanalie spotkalo cos sprawiedliwego.",
	["Listen, lad. I heard that the previous King of Rats, Robercik, has returned from his delegation. The stupid rats forgot that he used to be king, and when he tried to enter my kingdom, they kicked him out. I think he might have sneaked in somewhere, and now he's waiting for an opportunity to harm me. Injustice comes back like a boomerang."] = "Poc no tu, posluchoj. Slyszalem, ze z delegacji wrocil poprzedni krol szczurow - Robercik. Glupie szczury zapomnialy, ze kiedys on byl krolem, i gdy probowal wejsc do mojego krolestwa, to wyrzucily go na zbity pysk. Mysle, ze mogl sie gdzies zakrasc, i teraz czatuje na moje zycie. Niegodziwosc wraca jak bumerang.",
	["I don't know where he could be..."] = "Nie wiem gdzie on moze byc...",
	["Thanks, here's your reward. Robercik won't cause any more trouble."] = "Dzieki, oto twoja nagroda. Robercik nie bedzie juz sprawiac klopotow.",
	["I'm currently raising funds for an artistic bohemia. Come back when I'm closing or donate a symbolic {amount}. How about 100 platinum coins?"] = "Aktualnie organizuje zbiorke na boheme artystyczna. Wroc, jak juz bede zamykac albo wplac symboliczna {kwote}. Co bys powiedzial na 100 platynek?",
	["Ytong is Ytong."] = "Ytong to ytong.",
	["Then come back when I finish the fundraiser. The organization of the festival alone was worth at least 8 coronas extra."] = "W takim razie wroc, jak juz zakoncze zbiorke. Sama organizacja festiwala kosztowala co najmniej 8 zubrow.",
	["After the festival, an Wolfy's old man came to me. Inspired by art, he decided to break free from family violence and handed me his {wifebeater}."] = "Po festiwalu przyszedl do mnie stary wolfyego. Zainspirowany sztuka, postanowil zerwac z przemoca w rodzinie i oddal mi swoja {zonobijke}.",
	["I'll be closing soon. Come back for another mission later."] = "Niedlugo zamykam. Wroc za jakis czas po nastepna misje.",
	["I'm setting up a new minecraft server shortly. We're starting on Friday."] = "Zaraz stawiam nowy server minemaciekpl. W piatek ruszamy.",
	["GM Romek is starting a new minecraft server. Tell Wilson, a frequent visitor to old school servers, about Romek's known scams and acts of corruption."] = "GM Romek stawia kolejny scamerski serwer minecraft. Podbij do Wieslawa Wszywki i przestrzez go przed znanymi zagrywkami i koprupcka Romka.",
	["You tipped off Wilson. Now return to Romek and observe his reaction."] = "Dalej cynk Wieslawowi, ktory juz zajmie sie rozgloszeniem nieprzychylnych Romkowi informacji. Wroc do Romka i zaczekaj na jego reakcje.",
	["What!? That's corruption in a broad daylight! I'm not down for that. I'm going to investigate this case."] = "Coo!? Toz to - mianowicie - korupcja w bialy dzien. Nie przybilbym z nim szufli. Zajme sie naglosnieniem tej sprawy.",
	["The start is getting closer. I hope this time we can last more than a week."] = "Start coraz blizej. Mam nadzieje, ze tym razem sie uda ustac wiecej niz tydzien.",
	["That damn bald drunkard again. He's ruining my reputation."] = "A to jebany lysielec zapijaczony. Zepsuje mi cala reputacje.",
	["I have a simple job for you. Go to the southern Orc Fortess and read the map of their leader to find out where Brazil is located."] = "Mam dla ciebie prosta robotke. Udaj sie do poludniowej foretcy orkow i odczytaj z mapy ich lidera gdzie polozona jest brazylia.",
	["These discussions will eventually drive me to the grave. The fortress is south of Mirkotown."] = "Do grobu mnie wpedzisz tymi dyskusjami. Forteca znajduje sie na poludnie od mirkotown.",
	["Haha, yes! Finally, I know where that emigrant is. Are you ready for a new mission?"] = "Haha, tak! W koncu wiem gdzie jest ten esbek emigrant. Czy jestes gotowy na nowa misje?",
	["Pack your stuff in the car - we're going on a trip. You need to go to the Brazilian Ratland and defeat their king. Juerdo Titsgo is DDoSing my server, so players can't donate NFTs for an unjust but lucrative cause."] = "Pakuj dupe do auta - jedziemy na wycieczke. Musisz udac sie do brazylijskiej szczurolandii, i pokonac ich krola. Juerdo Titsgo ddosuje mi serwer, wiec gracze nie moga mi donejtowac eurogabek na cel niesluszny, ale lukratywny.",
	["Juerdo Titsgo is very short. He might hide somewhere when he sees you. His children, on the other hand, are huge mutants."] = "Juerdo Titsgo jest bardzo niski. Mozliwe, ze na twoj widok sie gdzies schowa. Jego dzieci natomiast sa ogromnymi zmutowancami.",
	["Choose your reward: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon)."] = "Wybierz swoja nagrode: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon).",
	["Thanks for your help. The DDoS attacks have stopped. Here's your reward."] = "Dzieki za pomoc. DDOS'y juz ustapily. Oto twoja nagroda. ",
	["Here's the final stage of initiation. If The chorus of januses is to judge our justice, then who judged them? Or is it just an illusion to cut us off from our human form and commit the ultimate embarrassment? I have to prove my loyalty to justice and commit genocide. You must help me commit genocide on my own faithful. It's fair and just. Ask about the {trial} if you're ready."] = "Oto ostatni etap inicjacji. Jesli chor januszy nasza sprawiedliwosc sadzic bedzie, to kto ich osadzil? A moze to tylko iluzja zeby odciac nas od zachowania ludzkiej formy i popelnic ostateczna kompromitacje? Musze udowodnic moja lojalnosc wobec sprawiedliwosci i dokonac ludobojstwa. Musisz mi pomoc dokonac ludobojstwa na moich wlasnych wiernych. Godne to i sprawiedliwe. Zapytaj o {probe}, jezeli jestes gotowy.",
	["I will judge our justice. Choose your reward: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon)."] = "Sprawiedliwosc nasza sadzic bede. Wybierz swoja nagrode: {axe}, {sword}, {mace}, {bow}, {rod}, {wand} (exercise weapon).",
	["Here's your reward. Come back to me sometime. For now, I think I'll take a break."] = "Oto twoja nagroda. Wroc do mnie za jakis czas. Na razie mysle, ze odpoczne.",
	["100 Year Old Aged Cheese"] = "Stuletni ser dojrzewajacy",
	["The book has been unsealed. You have one minute before its closed."] = "Ksiega sie odpieczetowala i zamknie sie za minute.",
	["The following book was inscribed by Justus Torturous and Cordian Dickens. \nThis book contains incantations of spells only available to the current King of Rats. \n\nVortex stinker - sends all nearby hostile creatures to the Rat Lands.\n\nTorturer, Oppressor, Tyrant - removes all ytong curses from selected person.\n\nUtori spiritus - wiadomo co (najlepsze, ze za darmo)\n\nDies irae dorime - implodes a creature, ceasing its existence and erases it from the universe. Requires all of The Five Great Artifacts and untold the secrets of black magic. Dampreefer might help find your way to obtain this knowledge."] = "Ponizszy tekst zostal spisany przez Sprawiedliweusza Oprawczego i Kutadeusza Mocium. \nKsiega ta zawiera inkantacje poteznych czarow, ktore moga byc rzucone wylacznie przez aktualnego krola szczurow. \n\nWir Smierdzielu - wysyla wszystkich pobliskich wrogow wokol do szczurolandii.\n\nCiemezco oprawco tyranie - zdjejmuje wszystkie klatwy ytonga z dowolnie wybranej osoby\n\nUtori spiritus - wiadomo co (najlepsze, ze za darmo)\n\nDies irae dorime - unicestwia dana istote, kasujac go ze wszechswiata. Wymaga wszystkich pieciu wielkich artefaktow oraz tajemnej wiedzy na temat czarnej magii. Smierdzichwast moze miec cos, co pomoze Ci uzyskac te wiedze.",
	["Librum Vortex. Romek, the King of Rats might be interested in it."] = "Librum Vortex. Krol szczurow moze byc nim zainteresowany.",
}
